import { Route, Routes } from "react-router-dom";
import "./App.css";
import Featureshow from "./component/featureshow";
import Projectshow from "./component/projectshow";
import Todolistshow from "./component/todolistshow";

const a = "hello world"
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Projectshow />} />
        <Route path="/feature" element={<Featureshow />} />
        <Route path="/todolist" element={<Todolistshow />} />
      </Routes>
    </div>
  );
}

export default App;
